import React from "react";


function contacts(props) {
  return <div className="card">
  <div className="top">
  <h2>{props.name}</h2>
  <img>{props.img}</img>

  </div>
  <div className="bottom">
  <p>{props.tel}</p>
  <p>{props.email}</p>

  </div>

  </div>
}


